import React from 'react'
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faLinkedin } from '@fortawesome/free-brands-svg-icons'
import { Link } from "react-router-dom";

const iconCode = <FontAwesomeIcon icon={faCode} />;
library.add(faLinkedin)

export default function Footer() {
    return (
        <div>
            <footer className="footer">
  <div className="content has-text-centered">
    <p>
      <strong>HelpMate</strong> by 
        <a href="https://www.linkedin.com/in/alix-de-ribet-237a48119/"><i class="fab fa-linkedin"></i> Alix</a>, 
        <a href="https://www.linkedin.com/in/camille-de-l%C3%A9pine-robinel-326925158/"><i class="fab fa-linkedin"></i> Camille</a> ,
        <a href="https://www.linkedin.com/in/pauline-morsli/"><i class="fab fa-linkedin"></i> Pauline</a> & 
        <a href="https://www.linkedin.com/in/wendy-evora-978653142/"><i class="fab fa-linkedin"></i> Wendy</a>.
    </p>
  </div>
</footer>
        </div>
    )
}
